import React from 'react';
import Navitem from './navitem';

function Sidebar(){
    return (
        <div>
            <div id = "navbar">
                <hr/>
                <Navitem item="Home" />
                <Navitem item="Study Matireals" />
                <Navitem item="Courses" />
                <Navitem item="Software" />
                <Navitem item="Internships" />
                <Navitem item="Courses" />
            </div>
            <div id = "test">
                <h1>Test</h1>
            </div>
        </div>);        
}

export default Sidebar;
